import React from 'react'

class MyComponent extends React.Component {
    state = {
        name: 'Thinh', 
        address: 'Binh dinh', 
        age: 20
    }; 
    // JSX
    render() {
        return (
            <div>
                my first component
                { Math.random() }
            </div>
        );
    }
}

export default MyComponent;
